export default {
    name: 'IntroPage',
    data () {
        return {
            message: ''
        }
    },
    created() {
        fetch('/main/api/intro/')
        .then(response => response.json())
        .then(data => {
            this.message = data.message
        })
        .catch(error => {
            console.error('Error fetching data:', error);
        });
    }
}
